import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


let greet = '';

const time = new Date();
const greetWord = document.querySelector('.greeting-text');

const hour = time.getHours() + 1;

if (hour > 1 && hour < 12){
  greet = 'Good Morning';
}else{
  greet = 'Good Evening';
  greetWord.classList.toggle('black');
}



ReactDOM.render(
  <>
    <div className="main-container">
      <div className="greeting-box">
        <div className="greet">
          <h1>Hello sir, <span className="greeting-text">{greet}</span></h1>
        </div>
      </div>
    </div>
  </>,
  document.getElementById('root')
);
